__NUXT_JSONP__("/drugs/Menin-MLL_Interaction_Inhibitor_KO_539", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"An orally bioavailable inhibitor of the menin-mixed lineage leukemia (MLL; myeloid\u002Flymphoid leukemia; KMT2A) fusion protein, with potential antineoplastic activity. Upon oral administration, menin-MLL interaction inhibitor KO 539 prevents the interaction between the two proteins menin and MLL, and thus the formation of the menin-MLL complex. This reduces the expression of downstream target genes and results in an inhibition of the proliferation of MLL-rearranged leukemic cells. The menin-MLL complex plays a key role in the survival, growth and proliferation of certain kinds of leukemia cells.",fdaUniiCode:"4MOD1F4ENC",identifier:"C164227",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C129824"],synonyms:["KO 539","KO-539","KO539","Menin-KMT2A Inhibitor KO 539","Menin-MLL Inhibitor KO-539",c,"Menin-Mixed Lineage Leukemia Protein-Protein Interaction Inhibitor KO 539"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FMenin-MLL_Interaction_Inhibitor_KO_539",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Menin-MLL_Interaction_Inhibitor_KO_539","Menin-MLL Interaction Inhibitor KO 539","2021-10-30T13:35:39.883Z")));